import React, {Component} from 'react'
import ReactDOM from 'react-dom'
import './styl/foo.styl'

<style lang="stylus" scoped>
 import "./styl/foo.styl"
</style>

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello, React!</h1>
      </div>
    )
  }
}

ReactDOM.render(<App />, document.getElementById('root'))
